column1:
Matheus Leitão | A primeira jogada de Ciro Gomes contra Lula após as eleições >>> https://veja.abril.com.br/coluna/matheus-leitao/a-primeira-jogada-de-ciro-gomes-contra-lula-apos-as-eleicoes/… (via 
@Mleitaonetto
) #VEJAColunistas

Comitê da campanha de Bolsonaro em Brasília vira sede para trama de golpe e atos antidemocráticos
QG DO GOLPE funciona sob comando do general Braga Netto
Alô 
@STF_oficial
 @alexandre

O 
@exercitooficial
 precisa se pronunciar. Não da maneira como os manifestantes pretendem, mas de maneira democrática e conciliatória. Você não precisa estar feliz com o resultado das eleições. Pode fazer oposição e deve fiscalizar.

Toda minha solidariedade a 
@cirogomes
 e 
@gisellebezerra
, amigo e amiga queridos. Esse ataque revela a face mais antidemocrática da direita que, não aceitando o resultado das eleições, faz de tudo para justificar sua derrota. Somos mais fortes e dignos que essa covardia!

"Quase um mês depois das eleições, desesperança toma conta de boa parte do país ainda sem rumo e à espera de um Congresso menos covarde".  Leia a reportagem completa de 
@silvionavarro
 na #RevistaOeste

"Dá impressão que parte do Estado está deixando Alexandre de Moraes enfrentar isso sozinho, para que ele pareça um obcecado"
@lf_ponde
 comenta para o #JornaldaCultura atitude do PL, partido de Bolsonaro, em questionar a legitimidade exclusivamente do segundo turno das eleições.

PL apresenta nova petição ao TSE que reitera o pedido de uma verificação extraordinária do resultado do 2º turno das eleições. “Alexandre de Moraes reagiu à altura”, diz 
@ECantanhede
.

 Assista ao #EmPauta com 
@cosmemarcelo
: http://glo.bo/39WjXAu #GloboNews

